// src/Land.js
import React from 'react';
import { BrowserRouter as Router, Routes, Route } from 'react-router-dom';
import App from './App';

function Land() {
  return (
    <Router>
      <div>
        <Routes>
          <Route path="/" element={<App />} />
        </Routes>
      </div>
    </Router>
  );
}

export default Land;
